import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import authService from "../../services/authService";

const Register = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    first_name: "",
    last_name: "",
    email: "",
    mobile_number: "",
    password: "",
    confirmPassword: "",
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (form.password !== form.confirmPassword) {
      alert("‚ùå M·∫≠t kh·∫©u kh√¥ng kh·ªõp!");
      return;
    }

    try {
      // ‚úÖ S·ª¨A L·∫†I PAYLOAD - ƒê√öNG FORMAT
      const payload = {
        first_name: form.first_name,
        last_name: form.last_name,
        email: form.email,
        password: form.password,
        mobile_number: form.mobile_number,
        role: {
          role_name: "USER",
        },
        address: {
          street: "Default Street",
          city: "Hanoi",
          state: "HN",
          country: "VN",
          pincode: "100000",
          building_name: "Building A", // ‚úÖ S·ª≠a th√†nh building_name v√† c√≥ gi√° tr·ªã
        },
        cart: {
          total_price: 0,
          products: [],
        },
      };

      console.log("üì§ Register payload:", JSON.stringify(payload, null, 2));

      const res = await authService.register(payload);
      console.log("‚úÖ REGISTER RESULT:", res.data);

      alert("‚úÖ ƒêƒÉng k√Ω th√†nh c√¥ng!");
      navigate("/login");

    } catch (error) {
      console.error("‚ùå REGISTER ERROR:", error.response?.data || error.message);
      console.error("üîç Error details:", error.response);

      // ‚úÖ HI·ªÇN TH·ªä L·ªñI CHI TI·∫æT
      const errorMessage = error.response?.data?.message || 
                          JSON.stringify(error.response?.data) || 
                          "Vui l√≤ng ki·ªÉm tra l·∫°i!";
      alert(`‚ùå ƒêƒÉng k√Ω th·∫•t b·∫°i: ${errorMessage}`);
    }
  };

  return (
    <section className="section-content padding-y">
      <div
        className="card mx-auto shadow"
        style={{ maxWidth: "520px", marginTop: "40px" }}
      >
        <article className="card-body">
          <header className="mb-4 text-center">
            <h4 className="card-title">Sign up</h4>
          </header>

          <form onSubmit={handleSubmit}>
            {/* T√™n */}
            <div className="form-row">
              <div className="col form-group">
                <label>First name</label>
                <input
                  name="first_name"
                  type="text"
                  className="form-control"
                  value={form.first_name}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="col form-group">
                <label>Last name</label>
                <input
                  name="last_name"
                  type="text"
                  className="form-control"
                  value={form.last_name}
                  onChange={handleChange}
                  required
                />
              </div>
            </div>

            {/* Email */}
            <div className="form-group">
              <label>Email</label>
              <input
                name="email"
                type="email"
                className="form-control"
                value={form.email}
                onChange={handleChange}
                required
              />
            </div>

            {/* S·ªë ƒëi·ªán tho·∫°i */}
            <div className="form-group">
              <label>Mobile number</label>
              <input
                name="mobile_number"
                type="text"
                className="form-control"
                value={form.mobile_number}
                onChange={handleChange}
                placeholder="Nh·∫≠p s·ªë ƒëi·ªán tho·∫°i"
              />
            </div>

            {/* M·∫≠t kh·∫©u */}
            <div className="form-row">
              <div className="form-group col-md-6">
                <label>Password</label>
                <input
                  name="password"
                  type="password"
                  className="form-control"
                  value={form.password}
                  onChange={handleChange}
                  required
                />
              </div>
              <div className="form-group col-md-6">
                <label>Repeat password</label>
                <input
                  name="confirmPassword"
                  type="password"
                  className="form-control"
                  value={form.confirmPassword}
                  onChange={handleChange}
                  required
                />
              </div>
            </div>

            <button type="submit" className="btn btn-primary btn-block">
              Register
            </button>
          </form>
        </article>
      </div>

      <p className="text-center mt-4">
        Have an account? <Link to="/login">Log In</Link>
      </p>
    </section>
  );
};

export default Register;
